import React,{useState} from 'react'
import Mapping from './Mapping'
import ControlBox from './ControlBox'
import PictureGallery from './PictureGallery'

export default function RightBody({onClick,setOnClick,setClickGallery,clickGallery}) {
    return (
        <>
            <ControlBox/>
            <Mapping onClick={onClick} setOnClick={setOnClick}/>
            {clickGallery ? <PictureGallery setClickGallery={setClickGallery} setClickBiggerImg={setClickBiggerImg} clickBiggerImg={clickBiggerImg}/>: ""}
        </>
    )
}
